1722003521359.css:
.card {
 font-family: arial;
 font-size: 20px;
 text-align: center;
 color: black;
 background-color: white;
}

.tag::before {
	content: "#";
}

.tag {
  color: white;
  background-color: #9F2BFF;
  border: none;
  font-size: 11px;
  font-weight: bold;
  padding: 1px 8px;
  margin: 0px 3px;
  text-align: center;
  text-decoration: none;
  cursor: pointer;
  border-radius: 14px;
  display: inline;
  vertical-align: middle;
}
 .cloze { font-weight: bold; color: blue;}.nightMode .cloze { color: lightblue;}

tmpls.qfmt:
{{Front}}
<p class="tags">{{Tags}}</p>

<script>
    var tagEl = document.querySelector('.tags');
    var tags = tagEl.innerHTML.split(' ');
    var html = '';
    tags.forEach(function(tag) {
	if (tag) {
	    var newTag = '<span class="tag">' + tag + '</span>';
           html += newTag;
    	    tagEl.innerHTML = html;
	}
    });
    
</script>

